import React from "react";
import { useState, useEffect } from "react";

const Main = () => {
  const [pageList, setPageList] = useState([]);

  useEffect(() => {
    fetch("/data/pageList.json")
      .then((result) => result.json())
      .then((data) => setPageList(data));
    console.log(pageList);
  }, [pageList]);

  return <div>Main</div>;
};

export default Main;
